import React, { Component } from 'react'
import { Redirect , Link } from 'react-router-dom';

import NavegacionAdmin from './NavegacionAdminHome'

export default class Home extends Component {

    constructor(){
        super();
        this.state={
            user:'',
            token: sessionStorage.getItem('token'),
        };
        this.cerrarSesion= this.cerrarSesion.bind(this);

    };

 
    cerrarSesion=()=>{
        sessionStorage.removeItem('token');
       
       
    }
    
    render() {
        return (
            this.state.token !== '' ? 
                <div>
                    <NavegacionAdmin/>

                    <div class="d-flex justify-content-center">
                    <Link className='btn btn-secondary' to="/libros">Libros</Link> 
                    <Link className='btn btn' to="/novedades">Novedades </Link>
                    <Link className='btn btn' to="/autores">Autores </Link>
                    <Link className='btn btn' to="/editoriales">Editoriales </Link>
                    <Link className='btn btn' to="/generos">Generos </Link>
                    <Link className='btn btn' to="/suscriptores">Suscriptores </Link>
                    </div>

                </div>
            :
            <Redirect to="/login"/>
        )
    }
}

